import { useEffect, useState } from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import OverlayTrigger from 'react-bootstrap/OverlayTrigger';
import axios from 'axios';
import { BASEURL } from './baseURL';


function DoctorSlotAdd() {

  const [date, setDate] = useState("");
  const [time, setTime] = useState("");

  return (
    <OverlayTrigger 
      trigger = "click"
      key = "right"
      placement="right"
      overlay={
        <Form style={
          {margin: 10 , backgroundColor: coral}
        }>
          <Form.Group className="mb-3" controlId="book_date" >
              <Form.Label>Date</Form.Label>
              <Form.Control
                  type = "date"
                  placeholder="Booking date"
                  required
                  onChange={(e) => setDate(e.target.value)}
              />
            </Form.Group>
            <Form.Group className="mb-3" controlId="book_time">
              <Form.Label>Time</Form.Label>
              <Form.Control
                  type = "time"
                  placeholder="Booking time"
                  required
                  onChange={(e) => setTime(e.target.value)}
              />
            </Form.Group>
          </Form>
      }
      >
      <Button variant="secondary">Add Slots</Button>
      </OverlayTrigger>
  )
}

export default DoctorSlotAdd
